import React, { useState, useEffect, useRef } from "react";
import "./App.css";
import jujinHeart from "./image/pkht.png";
import centerHeart from "./image/sujin.png";
import fairy from "./image/fairy.png";
import ground from "./image/ground.png";
import windowIcon from "./image/icon.png";
import clickSoundFile from "./sound/click.mp3";

function App() {
  const [hearts, setHearts] = useState([]);
  const [screen, setScreen] = useState("home");
  const [showGameContent, setShowGameContent] = useState(false);
  const [isFullscreen, setIsFullscreen] = useState(false);
  const audioRef = useRef(null);

  const toggleFullscreen = () => setIsFullscreen((prev) => !prev);
  const goToIntro = () => {
    audioRef.current?.play();
    setScreen("intro");
  };
  const startGame = () => setShowGameContent(true);

  useEffect(() => {
    const newHearts = Array.from({ length: 15 }, (_, i) => ({
      id: i,
      left: Math.random() * 100,
      size: 20 + Math.random() * 30,
      duration: 5 + Math.random() * 5,
    }));
    setHearts(newHearts);
  }, []);

  return (
    <div className="App">
      <audio ref={audioRef} src={clickSoundFile} preload="auto" />

      {/* Î∞òÏßùÏù¥ ÌïòÌä∏Îì§ */}
      {Array.from({ length: 25 }).map((_, i) => (
        <div
          key={i}
          className="sparkle-heart"
          style={{
            top: `${Math.random() * 100}%`,
            left: `${Math.random() * 100}%`,
            animationDelay: `${Math.random() * 5}s`,
          }}
        />
      ))}

      {screen === "home" && (
        <>
          {hearts.map((heart) => (
            <img
              key={heart.id}
              src={jujinHeart}
              className="floating-heart"
              style={{
                left: `${heart.left}%`,
                width: `${heart.size}px`,
                animationDuration: `${heart.duration}s`,
              }}
              alt="heart"
            />
          ))}

          <div className="center-heart-container">
            <img
              src={centerHeart}
              alt="center heart"
              className="center-heart"
              onClick={goToIntro}
            />
            <div className="heart-message">ÌïòÌä∏Î•º ÎàåÎü¨Ï§ò</div>
          </div>
        </>
      )}

      {(screen === "intro" || screen === "quiz") && (
        <div className="quiz-screen">
          <div className={`computer-window ${isFullscreen ? "fullscreen" : ""}`}>
            <div className="window-header">
              <img src={windowIcon} alt="icon" className="window-icon" />
              <span className="window-title">ÌÄ¥Ï¶à ÌÉÄÏûÑ</span>
              <div className="window-icons">
                <span className="icon">üóï</span>
                <span className="icon" onClick={toggleFullscreen}>üóñ</span>
                <span className="icon" onClick={() => setScreen("home")}>‚ùå</span>
              </div>
            </div>

            {!showGameContent ? (
              <div className="pink-content">
                <h2>üå∏ Îã§Î•∏ ÏΩòÌÖêÏ∏† Îì±Ïû•!</h2>
                <button className="start-btn" onClick={() => setScreen("quiz")}>ÏãúÏûëÌïòÍ∏∞</button>
              </div>
            ) : (
              <div className="game-content">
                <img src={ground} alt="background" className="game-background" />
                <img src={fairy} alt="fairy" className="fairy-character" />
              </div>
            )}
          </div>
        </div>
      )}
    </div>
  );
}

export default App;
